import React from "react";
import { useEffect, useState } from "react";

const Table = () => {
	const [artists, setArtists] = useState<AnyObject>();

	const url =
		"https://sheets.googleapis.com/v4/spreadsheets/1ihTMg293oX-0F5ujBPRkN2rfCg9o1l1yLZWeBgW9rSw/values/Sheet1!A:B?majorDimension=COLUMNS&key=AIzaSyC8KA4Chg1gzz6mvhp-4pH5mE03b49Js5U";
	const fetchData = async (controller: AbortController) => {
		const resp = await fetch(url, {
			signal: controller.signal,
		});

		if (!resp.ok) throw new Error("Explotó");

		const respData = await resp.json();
		console.log(respData);
		setArtists(respData);
	};

	useEffect(() => {
		let controller = new AbortController();

		fetchData(controller);

		return () => controller?.abort();
	}, []);

	let list = artists?.values[0].map((artist: string) => <li>{artist}</li>);

	return (
		<>
			<h1>hey</h1>
			<ul>List: {list}</ul>
		</> 
	);
};

interface AnyObject {
    [key: string]: any  
}

export default Table;
